import { useNavigate } from "react-router-dom";
// import qr from "./images/qr.jpeg";
import Card from "react-bootstrap/Card";
import { Button } from "react-bootstrap";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

function Qr1() {
  const navigate = useNavigate();
  return (
    <>
      <div style={{ margin: "auto", width: "50%" }} className="mt-5 mb-5">
        <br></br>
        <br></br>
        <div align="center">
          <Card style={{ width: "29rem" }}>
            <Card.Header>
              <h3>Donation Portal</h3>
            </Card.Header>
            <Card.Body>
              <form action="Success">
                <h3>Scan QR code</h3>
                Scan Barcode shown below and pay the Donation Click submit After
                Payment
                <br></br>
                <br></br>
                {/* <img src={qr} height={300} width={300} alt="qrcode" /> */}
                <br></br>
                <br></br>
                <Row>
                  <Col>
                    <Button
                      className="d-flex justify-content-right"
                      onClick={() => {
                        navigate("/success");
                      }}
                    >
                      Next
                    </Button>
                  </Col>
                  <Col>
                    {" "}
                    <Button
                      className="d-flex justify-content-right"
                      onClick={() => {
                        navigate("/moneyhome");
                      }}
                    >
                      Back
                    </Button>
                  </Col>
                </Row>
              </form>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default Qr1;
